NHẤT THƯ
1. khoản, món ; tiết mục, tin tức;
2. sự ghi thành từng khoản, sự ghi thành từng món

THANH TẢ CHÂN
1. ảnh được hiện ảnh bằng một loại muối cảm quang; bản thiết kế; 
kế hoạch đang trong giai đoạn dự định

XÍCH CƠ
1. lớp da bong (có màu đỏ); 
chỗ đất không có cây lộ ra ngoài

THƯỢNG VẬT
1. đồ cúng, đồ hiến tế; 
đồ ăn cho người khác; 
thu nhập; hoa màu thu hoạch được; thu nhập từ việc cho thuê nhà cửa, đất đai; 
vật cống vào cung

THƯỢNG BẢN
1. tấm phản làm giường có thể tháo dỡ để chứa đồ; 
tấm phản gỗ đặt trên bệ bê tông trong nhà tắm công cộng;
tấm lót lối đi từ sàn diễn đến hậu trường trong rạp hát

DỰ
1. giữ gìn, trông nom đồ đạc hay ai đó; 
tài liệu lưu các chứng cứ; 
trường hợp không phân thắng bại trong Sumo; 
người quản lý đền thờ hay trang viện; 
người được ủy nhiệm

ĐỐC
1. dày; nồng hậu; quá trình tiếp nhận tư tưởng mãnh liệt; bệnh nặng; ổn thoả; trơ trẽn, mặt dày
